import "./App.css";
import { Routes, Route } from "react-router-dom";
import Articleslist from "./components/Articaleslist";
import { Navbar } from "./components/Navbar";
import Accueil from "./components/Accueil";

function App() {
  return (
    <div className="App">
      {/* <Accueil /> */}
      <Routes>
        <Route path="/listproduits" element={<Articleslist />} />
      </Routes>
    </div>
  );
}

export default App;
